        <style type="text/css">
          /* Network Container Style */
          #mynetwork {
              width: 100%;
              height: 100vh;
              background-color: #e8d1d1;
              border: 1px solid lightgray;
              position: relative;
              float: left;
          }
  
          /* Typing Effect Styles */
          .column {
              width: 45%;
              margin: 10px;
              padding: 20px;
              border: 1px solid lightgray;
              border-radius: 5px;
              font-size: 16px;
              color: #333;
              background-color: #f9f9f9;
              box-shadow: 0 2px 5px rgba(0,0,0,0.1);
              overflow: hidden;
              white-space: nowrap;
          }
  
          /* Layout for columns */
          .container {
              display: flex;
              justify-content: space-around;
              align-items: flex-start; /*  vertical alignment */
              height: 100vh; /* Full viewport height */
          }
      </style>
